import * as React from "react";
import { Frame, Animatable, PropertyControls, ControlType } from "framer"

const style: React.CSSProperties = {
  height: "100%",
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
  textAlign: "center",
  color: "#8855FF",
  background: "transparent",
  overflow: "hidden"
};

interface Props {
  gifType: string,
  term: string,
  lock: boolean
}

export class Giphy extends React.Component {
  static defaultProps = {
    url: null,
    gifType: "Gif",
    term: "kitten",
    lock: false,
  };

  static propertyControls: PropertyControls<Props> = {
    gifType: {
      type: ControlType.Enum,
      title: "GIF Type",
      options: ["Gif", "Sticker"]
    },
    term: { type: ControlType.String, title: 'GIF Search' },
    lock: {
      type: ControlType.Boolean,
      title: "Lock GIF"
    }
  }

  state = {
    url: null
  };

  componentDidMount() {
    const { term, gifType, lock } = this.props;
    this.setGif(this.props);
  }

  componentWillReceiveProps(props: Props) {
    if (props.lock == false) this.setGif(props);
  }

  setGif({ term, gifType }: Props) {

    const baseURL = `http://api.giphy.com/v1`;
    const type = gifType === "Gif" ? "/gifs" : `/stickers`;
    const searchType = `/random?tag=`;
    const apiKey = `&api_key=dc6zaTOxFJmzC`;
    const searchTerm = term;
    const url = `${baseURL}${type}${searchType}${searchTerm}${apiKey}`;
    const xhr = new XMLHttpRequest();

    xhr.onreadystatechange = () => {
      if (xhr.readyState == XMLHttpRequest.HEADERS_RECEIVED) {
        this.setState({ url: xhr.responseURL });
      }
    };

    xhr.onload = () => {
      var response = JSON.parse(xhr.responseText);
      var data = response.data;
      this.setState({ url: data.images.downsized.url });
    };

    xhr.open("GET", url, true);
    xhr.send(null);
  }


  render() {
    const width = Animatable.getNumber(this.props.width)
    const height = Animatable.getNumber(this.props.height)

    var gifURL = this.state.url;
    var sticker = this.props.gifType === "Sticker" ? "none" : "block";

    return (
      <Frame key="gifFrame" width={width} height={height} style={{ backgroundColor: "transparent" }}>
        <div
          key="gif"
          style={{
            width: width,
            height: height,
            backgroundColor: "transparent",
            backgroundImage: `url(${gifURL})`,
            backgroundSize: "cover",
            backgroundPosition: "center",
            display: "flex", alignItems: "center", justifyContent: "center"
          }}>
          <div
            style={{
              fontSize: "12px",
              color: "#999",
              textAlign: "center",
              zIndex: -1,
              position: "relative",
              display: sticker
            }}>
            <img width="100%" src="data:image/png;base64," />
          </div>
        </div>
      </Frame>
    )
  }
}
